    public static char[][] testCode(double [][]A,int N){
        char[] list = {'a', 'b', 'c', 'd', 'e', 'f', 'g', 'h', 'i', 'j', 'k', 'l', 'm', 'n', 'o', 'p', 'q', 'r', 's', 't', 'u', 'v', 'w', 'x', 'y', 'z'};
        char[][] Wchar = get_Wn(N);
        double[] Pwdata = new double[Wchar.length];
        get_Bn(N);
        get_Tn(N);
        String str=String.valueOf(Bchar);
        for(int i=0;i<Wchar.length;i++){
            int tempnum = str.indexOf(Wchar[i][0]);
            if(tempnum<0)
                continue;
            int indexnum=Integer.valueOf(Wchar[i][0])-97;
            if(indexnum<0)
                continue;
            double Pi = Bdata[tempnum] * A[0][indexnum];
            if(Wchar[i].length > 1){
                for(int j=1;j<N;j++){
                    int indexnum2=Integer.valueOf(Wchar[i][j])-97;
                    if(indexnum2<0){
                        Pi=0;
                        break;
                    }
                    double Ait = A[j][indexnum2];
                    char[] trans = new char[2];
                    for(int k=0;k<2;k++)
                        trans[k] = Wchar[i][j-1+k];
                    String transString = String.valueOf(trans);
                    double Tst;

                    int num = indexofString(transString);
                    if( num != -1){
                        Tst = Tdata[num];
                    }else{
                        Tst = 0;
                    }
                    Pi = Pi* Ait * Tst;
                }
            }
            Pwdata[i] = Pi;
        }
        //用字符数组Wchar + double数组Pwdata来表示字典
        for(int i=0;i<Wchar.length-1;i++){
            for(int j=0;j<Wchar.length-i-1;j++){
                if(Pwdata[j]<Pwdata[j+1]){
                    double temp = Pwdata[j];
                    Pwdata[j] = Pwdata[j+1];
                    Pwdata[j+1] = temp;
                    char[] temp2 = Wchar[j];
                    Wchar[j] = Wchar[j+1];
                    Wchar[j+1] = temp2;
                }
            }
        }
        // System.out.println("result: ");
        char[][] result=new char[5][N];
        for(int i=0;i<Wchar.length&&i<5;i++){
            for(int j=0;j<Wchar[i].length;j++)
                result[i][j]=Wchar[i][j];
            //System.out.println(" "+ Pwdata[i]);
        }
        return result;
    }
    private static int indexofString(String str){
        for(int i=0;i<TString.length;i++){
            if(str.equals(TString[i])){
                return i;
            }
        }
        return -1;
    }

